package regexTest;

import java.util.regex.Matcher;
import java.util.regex.Pattern;

import org.junit.Test;

public class ImgDateURLPatternTest {
	private static String htmlCodes = "<img style=\"max-width: 480px;\" title=\"2.jpg\" src=\"data:image/jpeg;base64,\"><br>sdcdas<img style=\"max-width: 480px;\" title=\"3.jpg\" src=\"data:image/jpeg;base64,\"><br>";

	@Test
	public void test() {
		Pattern pattern = Pattern.compile("src=\"([A-Za-z0-9:/;,=\\+]*)\"");
		Matcher m = pattern.matcher(htmlCodes);
		while (m.find()) {
			System.out.println(m.group(1));
		}
	}

}
